import base64

def decode_base64(item):
    base64_str = item['json'].get('content', '')
    try:
        decoded = base64.b64decode(base64_str).decode('utf-8')
        return { "decoded": decoded }
    except Exception as e:
        return { "decoded": f"Erro: {str(e)}" }

return [decode_base64(item) for item in items]
